@Component({
  selector: 'app-home',
  templateUrl: './home.component.html',
  styleUrls: ['./home.component.scss']
})
export class HomeComponent {

}
<main>
  <div id="main-content" class="relative w-full h-full p-4 mx-auto overflow-y-auto text-center rounded-lg max-w-screen-2xl bg-gray-50 dark:bg-gray-900">
    <h1 class="mb-4 text-3xl font-extrabold text-gray-900 dark:text-white md:text-5xl lg:text-6xl">
      Welcome to<span class="text-transparent bg-clip-text bg-gradient-to-r to-emerald-600 from-sky-400"> GBrowser</span>
    </h1>
    <p class="text-lg font-normal text-gray-500 lg:text-xl dark:text-gray-400">
      The most accurate Counter Strike 2 community server list. We are currently tracking 20,000+ servers.
      You can easily find your favorite servers by filters and game modes like Zombie Escape, Surf, BunnyHop, Retake, AWP, and many more.
    </p>

  </div>
</main>
